class OmicronLIB(Pipeline):
    '''
    a Pipeline for oLIB
    '''
    pipeline = 'LIB'
    allowed_groups   = ['Burst', 'Test']
    allowed_searches = ['AllSky', None]

    def drawBCI(self):
        return max(random.normalvariate( 10, 3 ), 0)

    def drawBSN(self):
        return max(random.normalvariate( 50, 10 ), 0)

    def drawHrss(self):
        return {'posterior median' : max(random.normalvariate( 1e-22, 1e-23 ), 1e-25), 
                'posterior mean'   : max(random.normalvariate( 1e-22, 1e-23 ), 1e-25),
               }

    def drawFrequency(self):
        return {'posterior median' : max(random.normalvariate( 300, 25 ), 32),
                'posterior mean'   : max(random.normalvariate( 300, 25 ), 32),
               }

    def drawQuality(self):
        return {'posterior median' : max(random.normalvariate( 8, 1 ), 2),
                'posterior mean'   : max(random.normalvariate( 8, 1 ), 2),
               }

    def genFilename(self, directory="."):
        return super(OmicronLIB, self).genFilename(directory=directory, suffix='json') 

    def genFiles(self, directory='.'):
        '''
        write the files needed to create this event. Also return any files that are automatically uploaded shortly thereafter

        return firstFile, [(dt, message, otherFile1), (dt, message, otherFile2), ...]
        '''
        d = {0:{'gpstime'       : self.gps,
                'FAR'           : self.far,
                'raw FAR'       : self.far,
                'trials factor' : 1,
                'nevents'       : 1, 
                'likelihood'    : None,
                'BCI'           : self.drawBCI(),
                'BSN'           : self.drawBSN(),
                'instruments'   : ','.join(self.instruments),
                'timeslides'    : dict( (key,'0.0') for key in self.instruments ),
                'Omicron SNR'   : self.drawSNRs(),
                'hrss'          : self.drawHrss(),
                'frequency'     : self.drawFrequency(),
                'quality'       : self.drawQuality(), 
               },
            }
        filename = self.genFilename(directory=directory)
        file_obj = open(filename, 'w')
#        file_obj.write( json.dumps(d) )
        json.dump( d, file_obj )
        file_obj.close()

        return filename, []

class CoherentWaveBurst(Pipeline):
    '''
    a Pipeline for cWB
    '''
    pipeline         = 'CWB'
    allowed_groups   = ['Burst', 'Test']
    allowed_searches = ['AllSky', None]

    def drawRho(self):
        return max(random.normalvariate( 8, 1 ), 4)

    def drawStart(self):
        return min(random.normalvariate( -0.005, 0.001 ), 0) + self.gps

    def drawDuration(self):
        return max(random.normalvariate( 0.010, 0.001 ), 0.001)

    def drawFrequency(self):
        return max(random.normalvariate( 300, 50 ), 10)

    def drawBandwidth(self):
        return max(random.normalvariate( 100, 10 ), 10)

    def drawDec(self):
        return random.random()*180

    def drawRA(self):
        return random.random()*360

    def genFilename(self, directory="."):
        return super(CoherentWaveBurst, self).genFilename(directory=directory, suffix='txt') 

    def genFiles(self, directory='.'):
        '''
        write the files needed to create this event. Also return any files that are automatically uploaded shortly thereafter

        NOTE: cWB writes a LOT of info into txt files, most of which is completely ignored. I only reproduce the "key : value" pairs that are used.

        return firstFile, [(dt, message, otherFile1), (dt, message, otherFile2), ...]
        '''
        snrs = self.drawSNRs()
        d = [('rho'        , self.drawRho()),                                    ### shows up as "amplitude" on GraceDb
             ('likelihood' , snrs['Network']**2),                                ### used for "snr" on GraceDB
             ('ifo'        , " ".join(self.instruments)),
             ('start'      , "%.9f"%self.drawStart()),
             ('time'       , " ".join(str(self.gps) for _ in self.instruments)),
             ('duration'   , "%.9f"%self.drawDuration()),                               ### first entry shows up as duration
             ('phi'        , "0.000000 0.000000 %.6f"%self.drawRA()),            ### third entry shows up as ligo_axis_ra
             ('theta'      , "0.000000 0.000000 %.6f"%self.drawDec()),           ### third entry shows up as ligo_axis_dec
             ('frequency'  , "%.6f"%self.drawFrequency()),                       ### first entry shows up as bandwidth
             ('bandwidth'  , "%.6f"%self.drawBandwidth()),                       ### first entry shows up as bandwidth
             ('snr'        , " ".join("%.9e"%snrs[_] for _ in self.instruments)),
            ]
        filename = self.genFilename(directory=directory)
        file_obj = open(filename, "w")
        for key, val in d:
            print >> file_obj, "%s:\t%s"%(key, val)
        print >> file_obj, "search=r"
        print >> file_obj, "## number of events with rho>= rho of the event | corresponding rate | start time of the analyzed segment list | end time of the analyzed segment list | duration of the analyzed segment list"
        seglen = 86400
        print >> file_obj, "#significance based on the last day\n%d %.9f %d %d %d"%(int(self.far*seglen), self.far, self.gps-0.5*seglen, self.gps+0.5*seglen, seglen)
        print >> file_obj, filename
        file_obj.close()

        return filename, []

