class CBCPipeline(Pipeline):
    '''
    a Pipeline for CBC events
    '''
    pipeline = 'cbcPipeline'
    allowed_groups   = ['CBC', 'Test']

    def genFilename(self, directory="."):
        randStr = self.graceDBevent.get_randStr()
        coinc   = os.path.join(directory, self.pipeline+"_coinc_"+randStr+".xml")

        subdir = os.path.join(directory, randStr)
        if not os.path.exists(subdir):
            os.makedirs(subdir)

        copyCoinc = os.path.join(subdir, "coinc.xml")
        psd       = os.path.join(subdir, "psd.xml.gz")
        log       = os.path.join(subdir, "event.log")

        return coinc, copyCoinc, psd, log

    def genCoincXMLdoc(self):
        xmldoc = ligolw.Document()
        xml_element = ligolw.LIGO_LW()
        xmldoc.appendChild( xml_element )

        ### generate CoincInspiralTable?
        coinc = lsctables.New( lsctables.CoincInspiralTable, columns=['coinc_event_id', 'ifos', 'end_time', 'end_time_ns', 'mass', 'mchirp', 'minimum_duration', 'snr', 'false_alarm_rate', 'combined_far'] )
        xml_element.appendChild( coinc )

        snrs = self.drawSNRs()
        m1, m2 = self.drawMasses()

        row = lsctables.CoincInspiral()

        row.coinc_event_id   = ilwd.coinc_event_coinc_event_id_class(0) ### this is probably fragile...
        row.ifos             = ",".join(self.instruments) 
        row.end_time         = int(self.gps) 
        row.end_time_ns      = 1e9*(self.gps - row.end_time)
        row.mass             = m1+m2
        row.mchirp           = (m1*m2)**0.6/row.mass**0.2
        row.minimum_duration = 64,
        row.snr              = snrs['Network']
        row.false_alarm_rate = self.far
        row.combined_far     = self.far

        coinc.append( row )

        ### add in a SingleInspiralTable
        snglInsp = lsctables.New( lsctables.SnglInspiralTable, columns=[] )
        xml_element.appendChild( snglInsp )

        ### FIXME: need to actually fill in SingleInspiralTable
        ### then consider hooking this up via CoincMap and CoincTable elements

        return xmldoc

    def drawMasses(self):
        return random.normalvariate(1.4, 0.1), random.normalvariate(1.4,0.1)

    def genPSDXMLdoc(self):
        psdDict = dict()
        for ifo in self.instruments:
            f0 = 0
            deltaF = 0.125
            psd = simulateASD(0, 8193, df=0.125)**2
            size = len(psd)

            unit = 's^-1'
            gps = 0
            name = 'psd'

            psdDict[ifo] = lal.CreateREAL8FrequencySeries(name, gps, f0, deltaF, unit, size)
            psdDict[ifo].data.data = psd

        xmldoc = series.make_psd_xmldoc( psdDict, xmldoc=None )
        return xmldoc

    def genLog(self, xmldoc):
        coinc = table.get_table(xmldoc, lsctables.CoincInspiralTable.tableName)
        for row in coinc:
            ans ={'Pipeline': self.pipeline,
                  'Search'  : self.search,
                  'MChirp'  : row.mchirp,
                  'MTot'    : row.mass,
                  'End Time': row.end_time + 1e-9*row.end_time_ns,
                  'SNR'     : row.snr,
                  'IFOs'    : row.ifos,
                  'FAR'     : row.false_alarm_rate,
                 }
        return ans

    def writeLogFile(self, logData, filename ):
        file_obj = open(filename, 'w')
        for key, val in logData.items():
            print >> file_obj, "%s : %s"%(key, val)
        file_obj.close()

    def genFiles(self, directory='.'):
        '''
        write the files needed to create this event. Also return any files that are automatically uploaded shortly thereafter
        return firstFile, [(dt, message, otherFile1), (dt, message, otherFile2), ...]
        '''
        ### generate filenames
        coincFilename, copyCoincFilename, psdFilename, logFilename = self.genFilename(directory=directory)

        ### generate data and write them
        coincXMLdoc = self.genCoincXMLdoc()
        ligolw_utils.write_filename( coincXMLdoc, coincFilename, gz=coincFilename.endswith('.gz') )
        shutil.copy(coincFilename, copyCoincFilename)

        psdXMLdoc   = self.genPSDXMLdoc()
        ligolw_utils.write_filename( psdXMLdoc, psdFilename, gz=psdFilename.endswith('.gz') )

        logData     = self.genLog(coincXMLdoc)
        self.writeLogFile( logData, logFilename )

        shutil.copy( coincFilename, copyCoincFilename ) ### copy coincFilename -> copyCoincFilename

        ### return
        ancilliary = [
                      (max(0, random.normalvariate(0.5,1)), 'Log File Created', logFilename),
                      (max(0, random.normalvariate(1,0.1)), 'Coinc Table created', copyCoincFilename), 
                      (max(0, random.normalvariate(10, 1)), 'strain spectral densities', psdFilename),
                     ]
        ancilliary.sort(key=lambda l:l[0])
        return coincFilename, ancilliary

class GSTLAL(CBCPipeline):
    '''
    a Pipeline for GSTLAL
    '''
    pipeline = 'gstlal'
    allowed_searches = ['AllSky', 'LowMass', 'HighMass', 'MDC', None]

    def genRankFilename(self, directory='.'):
        return os.path.join(directory, 'ranking_data.xml.gz')

    def genRankXMLdoc(self):
        xmldoc = ligolw.Document()
        xml_element = ligolw.LIGO_LW()
        xmldoc.appendChild( xml_element )

        ### just upload an empty xml for now?
#        raise NotImplementedError

        return xmldoc

    def genFiles(self, directory='.'):
        coincFilename, ancilliary = super(GSTLAL,self).genFiles(directory=directory)

        rankFilename = self.genRankFilename(directory=os.path.dirname(ancilliary[0][-1]))
        rankXMLdoc = self.genRankXMLdoc()
        ligolw_utils.write_filename( rankXMLdoc, rankFilename, gz=rankFilename.endswith('.gz') )

        ancilliary.append( (max(0, random.normalvariate(15, 1)), 'ranking statistic PDFs', rankFilename) )
        ancilliary.sort( key=lambda l:l[0] )
        return coincFilename, ancilliary 

